var pageController={init:()=>{var t=document.getElementById("countryCards");fetch("https://restcountries.eu/rest/v2/all").then((t=>t.json())).then((e=>{e.forEach((e=>{console.log(e);var n=document.createElement("div");n.className="col",n.innerHTML='<div class="card shadow-sm"><img src="'+e.flag+'" class="card-img-top" alt="'+e.name+'"><div class="card-body"><p class="card-text">'+e.name+'</p><div class="d-flex justify-content-between align-items-center"><div class="btn-group"><button type="button" class="btn btn-sm btn-outline-secondary">View</button><button type="button" class="btn btn-sm btn-outline-secondary">Edit</button></div><small class="text-muted">Dynamic API data</small></div></div></div>',t.appendChild(n)}))})).catch((t=>{console.error(t)}))}};